function [TargetV,TargetH,TargetC,Inc] = FlightTaskSelctor(North,East,FlightTask,id)

dx = FlightTask(id).X - FlightTask(id-1).X;
dy = FlightTask(id).Y - FlightTask(id-1).Y;

TargetC = atan(abs(dy/dx));

if dx < 0 && dy  > 0
    TargetC = -abs(TargetC) + deg2rad(180);
end

if dx < 0 && dy < 0
    TargetC = abs(TargetC) + deg2rad(180);
end

if dx > 0 && dy < 0
    TargetC = -abs(TargetC) + deg2rad(360);
end

TargetV = FlightTask(id).V;
TargetH = FlightTask(id).H;

Inc = 0;
log = norm([North-FlightTask(id).X,East-FlightTask(id).Y]);
if norm([North-FlightTask(id).X,East-FlightTask(id).Y]) < 500
    Inc = 1;
end

function deltha  = fcn(id, targetC, N, E, FlightTask)

dx = N - FlightTask(id-1).X;
dy = E - FlightTask(id-1).Y;

C = atan(abs(dy/dx));

if dx == 0
   C = 0; 
end

if dx < 0 && dy  > 0
    C = -abs(C) + deg2rad(180);
end

if dx < 0 && dy < 0
    C = abs(C) + deg2rad(180);
end

if dx > 0 && dy < 0
    C = -abs(C) + deg2rad(360);
end

dc = targetC - C;

deltha = norm([dx,dy])*sin(dc);

function y = fcn(dc,uC,uL,triggerDC)

y = uC;

if abs(dc) <  triggerDC 

    y = uL;

end
